  render() {
    const { datosPersonas,eliminarPersona } = this.props;
    return (
      <table className="table">
        <HeadTabla />
        <BodyTabla datosPersonas={datosPersonas}
 eliminarPersona={eliminarPersona} />      </table>
    );
  }
}
export default Tabla;
